Paralax={init:function(){$(".paralax").each(function(){var a=$(this),o=a.data("start"),i=a.data("end");a.data("speed");$(window).scroll(function(){var t=($(window).height(),$(window).width()),n=a.data("adjustment"),d=-(($(window).scrollTop()-a.offset().top)/a.data("speed")+n),e="50% "+d+"px";t>500&&Paralax.isScrolledIntoView(o,i)&&a.css({backgroundPosition:e})})})},isScrolledIntoView:function(a,o){var i=$(window),t=i.scrollTop();return t>a&&o>t}},$(document).ready(function(){Mobile.isMobile||Paralax.init()});